INSERT INTO `t_dynasty_comments` VALUES (1,92,'自告天地定鼎燕京，至孫中山就任總統'),(2,91,'自朱元璋郊祀即位，至朱由檢煤山殉國'),(3,89,'自忽必烈改號大元，至徐達率兵入元都'),(4,86,'自應天府趙構受命，至陸秀夫負昺投海'),(5,85,'自趙匡胤稱宋改元，至靖康變金主詔廢'),(6,67,'自李淵太極殿即位，至李柷遜位朱全忠'),(7,66,'自楊堅登極臨光殿，至令狐行達縊揚廣'),(8,39,'自司馬炎柴燎告天，至失長安愍帝出降'),(9,40,'自司馬睿建康稱王，至琅邪第百官拜辭'),(10,34,'自光武帝燔燎告天，至獻帝祠廟奉璽綬'),(11,31,'自即帝位氾水之陽，至王莽鴆弒孝平帝'),(12,28,'自併六國改年始亥，至沛公破秦降子嬰'),(13,69,'自朱溫稱制開封府，至皇甫麟進刃末帝'),(14,70,'自李存勗牙城登壇，至末帝自燔玄武樓'),(15,71,'自契丹冊立兒皇帝，至石重貴反遼遭俘'),(16,72,'自劉知遠太原受冊，至郭允剚刃劉承祐'),(17,73,'自握神器郭威踐祚，至趙匡胤黃袍加身'),(18,58,'自蕭道成南郊即位，至蕭寶融禪位梁王'),(19,59,'自梁高祖柴燎告天，至梁敬帝禪位於陳'),(20,60,'自陳霸先即位南郊，至陳叔寶解甲就擒'),(21,35,'自曹丕繁陽亭登壇，至曹奐奉璽禪晉王'),(22,36,'自劉備武擔延漢祚，至劉禪縛面降鄧艾'),(23,37,'自見黃龍孫權登極，至鼓譟石頭吳歸晉'),(24,29,'自西楚霸王都彭城，至壁垓下烏江自刎'),(25,32,'自順符命王莽去漢，至公賓就斬新朝帝'),(26,46,'自苻健長安登單于，至乞伏歸乾驅苻崇'),(27,47,'自姚萇馬牧稱單于，至姚泓出降王鎮惡'),(28,57,'自劉裕柴燎石頭城，至劉準遜位于東邸'),(29,61,'自拓跋珪大會牛川，至高歡迫元修西奔'),(30,64,'自高洋南郊即帝位，至高恒禪位大丞相'),(31,65,'自宇文覺即天王位，至宇文衍遜位別宮'),(32,68,'自易正朔武曌稱制，至李顯監國復稱唐'),(33,87,'自阿保機告天即位，至完顏婁室獲遼主'),(34,88,'自阿骨打稱號建元，至幽蘭軒哀宗自縊'),(35,122,'自鐵木真會斡難河，至忽必烈改號大元');
